// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/Counters.sol";

interface ERC20Mintable
{
    function mint(address to, uint256 amount) external;
}

contract CiviaERC20Check {
    using Counters for Counters.Counter;

    Counters.Counter private _id;
    struct ContractInfo {
        uint256 id;
        address admin;
    }
    mapping (address => ContractInfo) public erc20Info;
    mapping (address => uint256[]) public userRegisteTokens;
    mapping (uint256 => address) public tokenIdAddrMaps;

    mapping (address => mapping (uint256 => uint256)) private userOwnMaps;  // account => erc20id => ownId

    address private _admin;
    constructor(address admin) {
        _admin = admin;
        _id.increment();
    }

    function registERC20(address addr) external {
        require(erc20Info[addr].id == 0, "token already exists");
        
        erc20Info[addr].id = _id.current();
        erc20Info[addr].admin = msg.sender;

        userRegisteTokens[msg.sender].push(erc20Info[addr].id);
        tokenIdAddrMaps[erc20Info[addr].id] = addr;

        _id.increment();
    }

    function getOwnedTokenCurrentId(address account, address tokenAddr) public view returns (uint256) {
        require(erc20Info[tokenAddr].id > 0, "token not registed");
        return userOwnMaps[account][erc20Info[tokenAddr].id];
    }
    function getOwnedTokensCurrentIds(address account, address[] memory tokenAddrs) public view returns (uint256[] memory) {
        uint256[] memory ids = new uint256[](tokenAddrs.length);
        for (uint256 i = 0; i < tokenAddrs.length; ++i) {
            ids[i] = getOwnedTokenCurrentId(account, tokenAddrs[i]);
        }
        return ids;
    }

    function verifySign(address tokenAddr, address account, uint256 beginId, uint256 endId, uint256 amount, uint8 v, bytes32 r, bytes32 s) internal view returns(address) {
        bytes32 messageHash = keccak256(
            abi.encodePacked(
                erc20Info[tokenAddr].admin,
                account,
                tokenAddr,
                beginId,
                endId,
                amount
            )
        );
        bytes32 prefixedHash = keccak256(abi.encodePacked("\x19Ethereum Signed Message:\n32", messageHash));
        return ecrecover(prefixedHash, v, r, s);
    }
    function mintToken(address tokenAddr, address account, uint256 endId, uint256 mintAmount) internal {
        require(erc20Info[tokenAddr].id > 0, "mintToken: token not registed");

        ERC20Mintable(tokenAddr).mint(account, mintAmount);
        userOwnMaps[account][erc20Info[tokenAddr].id] = endId;
    }
    function batchMintOne(address tokenAddr, address account, uint256[] memory beginIds, uint256[] memory endIds, uint256[] memory amounts, uint8[] memory v1, bytes32[] memory r1, bytes32[] memory s1, uint8[] memory v2, bytes32[] memory r2, bytes32[] memory s2) public {
        require(amounts.length == v1.length && amounts.length == beginIds.length && amounts.length == endIds.length && amounts.length == r1.length && amounts.length == s1.length && amounts.length == v2.length && amounts.length == r2.length && amounts.length == s2.length, "Invalid input");

        require(beginIds[0] == (getOwnedTokenCurrentId(account, tokenAddr) + 1), "batchMintOne: start id not match");

        uint256 mintAmount = 0;
        for (uint256 i = 0; i < amounts.length; i++) {
            require(verifySign(tokenAddr, account, beginIds[i], endIds[i], amounts[i], v1[i], r1[i], s1[i])==erc20Info[tokenAddr].admin, "Invalid signature admin");
            require(verifySign(tokenAddr, account, beginIds[i], endIds[i], amounts[i], v2[i], r2[i], s2[i])==account, "Invalid signature user");
            mintAmount += amounts[i];
        }

        mintToken(tokenAddr, account, endIds[endIds.length-1], mintAmount);
    }
    function batchMint(address[] memory tokenAddrs, address[] memory accounts, uint256[] memory beginIds, uint256[] memory endIds, uint256[] memory amounts, uint8[] memory v, bytes32[] memory r_s) public {
        require(amounts.length == tokenAddrs.length && amounts.length == accounts.length && amounts.length == beginIds.length && amounts.length == endIds.length && amounts.length*2 == v.length && amounts.length*4 == r_s.length, "Invalid input");

        address currentToken = tokenAddrs[0];
        address currentUser = accounts[0];

        require(beginIds[0] == (getOwnedTokenCurrentId(currentUser, currentToken) + 1), "batchMint: start id not match");
        uint256 mintAmount = amounts[0];

        for (uint256 i = 0; i < amounts.length; i++) {
            require(verifySign(tokenAddrs[i], accounts[i], beginIds[i], endIds[i], amounts[i], v[i*2], r_s[i*4], r_s[i*4+1])==erc20Info[tokenAddrs[i]].admin, "Invalid signature admin");
            require(verifySign(tokenAddrs[i], accounts[i], beginIds[i], endIds[i], amounts[i], v[i*2+1], r_s[i*4+2], r_s[i*4+3])==accounts[i], "Invalid signature user");
            if (i > 0) {
                if (keccak256(abi.encodePacked(tokenAddrs[i]))==keccak256(abi.encodePacked(currentToken)) && keccak256(abi.encodePacked(accounts[i]))==keccak256(abi.encodePacked(currentUser))) {
                    require(beginIds[i] == (endIds[i-1] + 1), "batchMint: id is not continous");
                    mintAmount += amounts[i];
                } else {
                    mintToken(currentToken, currentUser, endIds[i-1], mintAmount);

                    currentToken = tokenAddrs[i];
                    currentUser = accounts[i];
                    require(beginIds[i] == (getOwnedTokenCurrentId(currentUser, currentToken) + 1), "batchMint: start id not match");
                    mintAmount = amounts[i];
                }
            }
            if (i == amounts.length - 1) {
                mintToken(currentToken, currentUser, endIds[i], mintAmount);
            }
        }
    }

