    function getERC20TokenAddrByIds(uint256[] memory ids) public view returns (address[] memory) {
        address[] memory tokenAddrs = new address[](ids.length);
        for (uint256 i = 0; i < ids.length; ++i) {
            tokenAddrs[i] = tokenIdAddrMaps[ids[i]];
        }
        return tokenAddrs;
    }
